import React from "react";
import SideBarItem from "./sideBarItem";

const divStyle = {
	width: "50vw",
	height: "50vh",
	position: "fixed",
	zIndex: "100",
	left: "0px",
	backgroundColor: "white"
};
const logoStyle = {
	height: "155px",
	width: "155px"
};

export default function SideBar(props) {
	return (
		<div id="sideBar" style={divStyle}>
			<img src={props.logo} alt="Shed Logo" style={logoStyle} />
			{props.sections.forEach(section => {
				return <SideBarItem title={section} />;
			})}
		</div>
	);
}
